    <div class="question-body" v-else>
        <!-- title -->
        <div class="title">{{ title }}</div>
        <div class="desc">
            {{ desc || '根据过去两周的状况，请回答是否存在下列描述的状况及频率，请看清问题后再作答。' }}
        </div>
        <div class="question-list">
            <div class="item" v-for="(item, index) in questionList.slice(currentPage * 6, currentPage * 6 + 6)">
                <!-- 题目名称 -->
                <span>{{ (index + 1) + ". " + item.questionContent }}</span>
                <!-- 单选框 -->
                <div class="checkbox-group">
                    <a-radio-group style="display:flex;flex-direction:column;gap:10px;"
                        v-model:value="evaluateStore.judgeMap[title][item.index]">
                        <a-radio v-for="option in item.optionVos" :value="option.optionId">{{ option.optionContent
                        }}</a-radio>
                    </a-radio-group>
                </div>
            </div>
        </div>
