            <a-button style="background-color: #1A6FAC;color: #fff;border-radius: 10px;" @click="handlerPrev"
                v-if="currentPage != 0">上一页</a-button>
            <a-button @click="handlerCancel">取消</a-button>
            <a-button style="background-color: #1A6FAC;color: #fff;border-radius: 10px;" @click="handlerSubmit"
                v-if="(currentPage * 6 + 6) >= questionList.length">提交</a-button>
            <a-button style="background-color: #1A6FAC;color: #fff;border-radius: 10px;" @click="handlerNext"
                v-else>下一页</a-button>
        </div>
    </div>
</template>
<script lang="ts" setup>
import { onMounted, watch, ref, computed } from 'vue'
import { EvaluateStore } from '@/store/evaluate.store'
import router from '@/router/index'
const evaluateStore = EvaluateStore()
const isFinish = ref(false)
const operationID = ref("")
const idsList = ref<any>([])
type Props = {
    id: string
}
const finishForm = ref<any>({})
const findScoreInOptions = (id: number) => {
    function findScoreInOptions(options: any) {
        return options.find((ele: any) => ele.optionId == id).optionScore
    }
    for (const item of questionList.value) {
        const ele = item.optionVos.find((ele: any) => ele.optionId == id)
        if (ele) {
            console.log({ score: findScoreInOptions(item.optionVos), questionId: item.questionId })
            return { score: findScoreInOptions(item.optionVos), questionId: item.questionId }
        }
    }
}
const handlerSubmit = () => {
    const token = window.localStorage.getItem("token")
    let result = []
    for (const item of evaluateStore.judgeMap[title.value]) {
        const entity = findScoreInOptions(item)
        result.push({
            optionId: item,
            questionId: entity?.questionId,
            score: entity?.score,
            assessmentId: props.id,
            assessmentsResultId: evaluateStore.currentRecordsId,
            recordsId: evaluateStore.userId
        })
    }
    if (idsList.value.length!=0) {
        console.log(idsList.value)
        result = result.map((ele:any,index:number)=>{
            return {
                ...ele,
                id: idsList.value.find((ide:any)=>ide.questionId == ele.questionId).id
            }
        })
        fetch("/api/assessment", {
            method: 'PUT',
            headers: {
                'Content-type': 'application/json',
                token: token + ""
            },
            body: JSON.stringify(result)
        }).then(res => res.json())
            .then(data => {
                finishForm.value = data.data
                isFinish.value = true
                currentPage.value = 0
            })
    } else {
        fetch(`/api/assessment/result/${evaluateStore.currentRecordsId}/${evaluateStore.userId}`, {
            method: 'POST',
            headers: {
                'Content-type': 'application/json',
                token: token + ""
            },
            body: JSON.stringify(result)
        }).then(res => res.json())
            .then(data => {
                if (data.msg == "操作成功") {
                    isFinish.value = true
                    currentPage.value = 0
                    finishForm.value = data.data
                }
            })
    }

}
const reset = ()=>{
    const token =window.localStorage.getItem("token")
    fetch(`/api/assessment/answer/${evaluateStore.currentRecordsId}/${props.id}`,{
        method: 'GET',
        headers: {
            'Content-type': 'application/json',
            token: token+""
        }
    }).then(res=>res.json())
    .then(data=>{
        isFinish.value = false
        evaluateStore.judgeMap[title.value] = data.data.map((ele:any)=>ele.optionId)
        idsList.value = data.data
        currentPage.value = 0
    })
}
const handlerCancel = () => {
    router.push("/evaluate")
}
const handlerPrev = () => {
    currentPage.value--
}
const handlerNext = () => {
    currentPage.value++
}
const props = defineProps<Props>()

const title = ref<string>("")
const desc = ref<string>("")

const currentPage = ref(0)

const questionList = ref<any>([])

watch(props, () => {
    loadData()
})

onMounted(() => {
    loadData()
})
const loadData = () => {
    idsList.value = []
    isFinish.value = false
    const token = window.localStorage.getItem("token")
    if(props.id == ""){
        return
    }
    fetch(`/api/assessment/${props.id}`, {
        method: 'GET',
        headers: {
            'Content-type': 'application/json',
            token: token + ""
        }
    }).then(res => res.json())
        .then(data => {
            title.value = data.data.questionnaireName
            desc.value = data.data.ps
            evaluateStore.judgeMap[data.data.questionnaireName] = []
            // 将数组进行构造
            for (let i = 0; i < data.data.questionVos.length; i++) {
                evaluateStore.judgeMap[data.data.questionnaireName].push({})
            }
            questionList.value = data.data.questionVos.map((ele: any, index: number) => { return { ...ele, index: index } })
        })
}
const resultArr = computed(() => {
    let result = []
    if(finishForm.value.guidance == null){
        return []
    }
    for (const item of finishForm.value.guidance.split("\n")) {
        result.push(item)
    }
    return result
})

</script>
